    // }
    // setTheme();

    function setCookie(name, value, days) {
        let expires = "";
        if (days) {
            let date = new Date();
            date.setTime(date.getTime() + (days * 24 * 60 * 60 * 1000));
            expires = "; expires=" + date.toUTCString();
        }
        document.cookie = name + "=" + (value || "") + expires + "; path=/";
    }

    function mandatoryCookies() {
        // sd
        let theme = JSON.parse(localStorage.getItem('theme'));
        if (theme) {
            let value = theme === 'light' ? 'day' : 'night';
            setCookie('themeState', value, 365)
        }

        // wp
        let langValue = getCookie('pll_language')
        console.log(langValue)
        langValue ? setCookie('pll_language', langValue, 365) : setCookie('pll_language', 'uk', 365);
        // tech
        setCookie('cookieAccepted', 'true', 365);
        localStorage.setItem('showBanner', 'true')
    }

    function selectGoogleCookie() {
        if (localStorage.getItem('google') === null) {
            setCookie('google', 'accepted', 720);
        } else if (JSON.parse(localStorage.getItem('google')) === 'true') {
            setCookie('google', 'accepted', 720);
        } else {
            setCookie('google', 'rejected', 720);

        }
    }

    function selectMetaCookie() {
        if (localStorage.getItem('google') === null) {
            setCookie('meta', 'accepted', 720);
        } else if (JSON.parse(localStorage.getItem('meta')) === 'true') {
            setCookie('meta', 'accepted', 720);
        } else {
            setCookie('meta', 'rejected', 720);
        }
    }

